{
  "definitions": {},
  "$schema": "http://json-schema.org/draft-07/schema#",
  "$id": "http://example.com/root.json",
  "type": "object",
  "title": "The Root Schema",
  "required": [
    "code",
    "message",
    "data"
  ],
  "properties": {
    "code": {
      "$id": "#/properties/code",
      "type": "number",
      "title": "The Code Schema",
      "default": 0,
      "examples": [
        0
      ]
    },
    "message": {
      "$id": "#/properties/message",
      "type": "string",
      "title": "The Message Schema",
      "default": "",
      "examples": [
        "Success"
      ],
      "pattern": "^(.*)$"
    },
    "data": {
      "$id": "#/properties/data",
      "type": "object",
      "title": "The Data Schema",
      "required": [
        "user",
        "token"
      ],
      "properties": {
        "user": {
          "$id": "#/properties/data/properties/user",
          "type": "object",
          "title": "The User Schema",
          "required": [
            "id",
            "name",
            "images",
            "first_name",
            "last_name",
            "date_of_birth",
            "email",
            "active"
          ],
          "properties": {
            "id": {
              "$id": "#/properties/data/properties/user/properties/id",
              "type": "number",
              "title": "The Id Schema",
              "default": 0,
              "examples": [
                1177
              ]
            },
            "name": {
              "$id": "#/properties/data/properties/user/properties/name",
              "type": "string",
              "title": "The Name Schema",
              "default": "",
              "examples": [
                "A User"
              ],
              "pattern": "^(.*)$"
            },
            "images": {
              "$id": "#/properties/data/properties/user/properties/images",
              "type": "object",
              "title": "The Images Schema",
              "required": [
                "small_url",
                "medium_url",
                "large_url",
                "original_url"
              ],
              "properties": {
                "small_url": {
                  "$id": "#/properties/data/properties/user/properties/images/properties/small_url",
                  "type": "string",
                  "title": "The Small_url Schema",
                  "default": "",
                  "examples": [
                    "https://showoff-rails-react-api-production.s3.amazonaws.com/users/images/missing/missing.jpg"
                  ],
                  "pattern": "^(.*)$"
                },
                "medium_url": {
                  "$id": "#/properties/data/properties/user/properties/images/properties/medium_url",
                  "type": "string",
                  "title": "The Medium_url Schema",
                  "default": "",
                  "examples": [
                    "https://showoff-rails-react-api-production.s3.amazonaws.com/users/images/missing/missing.jpg"
                  ],
                  "pattern": "^(.*)$"
                },
                "large_url": {
                  "$id": "#/properties/data/properties/user/properties/images/properties/large_url",
                  "type": "string",
                  "title": "The Large_url Schema",
                  "default": "",
                  "examples": [
                    "https://showoff-rails-react-api-production.s3.amazonaws.com/users/images/missing/missing.jpg"
                  ],
                  "pattern": "^(.*)$"
                },
                "original_url": {
                  "$id": "#/properties/data/properties/user/properties/images/properties/original_url",
                  "type": "string",
                  "title": "The Original_url Schema",
                  "default": "",
                  "examples": [
                    "https://showoff-rails-react-api-production.s3.amazonaws.com/users/images/missing/missing.jpg"
                  ],
                  "pattern": "^(.*)$"
                }
              }
            },
            "first_name": {
              "$id": "#/properties/data/properties/user/properties/first_name",
              "type": "string",
              "title": "The First_name Schema",
              "default": "",
              "examples": [
                "A"
              ],
              "pattern": "^(.*)$"
            },
            "last_name": {
              "$id": "#/properties/data/properties/user/properties/last_name",
              "type": "string",
              "title": "The Last_name Schema",
              "default": "",
              "examples": [
                "User"
              ],
              "pattern": "^(.*)$"
            },
            "date_of_birth": {
              "$id": "#/properties/data/properties/user/properties/date_of_birth",
              "type": "null",
              "title": "The Date_of_birth Schema",
              "default": null,
              "examples": [
                null
              ]
            },
            "email": {
              "$id": "#/properties/data/properties/user/properties/email",
              "type": "string",
              "title": "The Email Schema",
              "default": "",
              "examples": [
                "michael+wwwwwdfdfd2@showoff.ie"
              ],
              "pattern": "^(.*)$"
            },
            "active": {
              "$id": "#/properties/data/properties/user/properties/active",
              "type": "boolean",
              "title": "The Active Schema",
              "default": false,
              "examples": [
                true
              ]
            }
          }
        },
        "token": {
          "$id": "#/properties/data/properties/token",
          "type": "object",
          "title": "The Token Schema",
          "required": [
            "access_token",
            "token_type",
            "expires_in",
            "refresh_token",
            "scope",
            "created_at"
          ],
          "properties": {
            "access_token": {
              "$id": "#/properties/data/properties/token/properties/access_token",
              "type": "string",
              "title": "The Access_token Schema",
              "default": "",
              "examples": [
                "ef91fa8d0561ebfdf37c140672f5d7c6f400b4a3a6876b5186ac3ddd2d78817d"
              ],
              "pattern": "^(.*)$"
            },
            "token_type": {
              "$id": "#/properties/data/properties/token/properties/token_type",
              "type": "string",
              "title": "The Token_type Schema",
              "default": "",
              "examples": [
                "Bearer"
              ],
              "pattern": "^(.*)$"
            },
            "expires_in": {
              "$id": "#/properties/data/properties/token/properties/expires_in",
              "type": "number",
              "title": "The Expires_in Schema",
              "default": 0,
              "examples": [
                2592000
              ]
            },
            "refresh_token": {
              "$id": "#/properties/data/properties/token/properties/refresh_token",
              "type": "string",
              "title": "The Refresh_token Schema",
              "default": "",
              "examples": [
                "b63824cdb1816fec3f2f5a92a9379bff56ee63ada4cc36d1c7fa3a90b026f04f"
              ],
              "pattern": "^(.*)$"
            },
            "scope": {
              "$id": "#/properties/data/properties/token/properties/scope",
              "type": "string",
              "title": "The Scope Schema",
              "default": "",
              "examples": [
                "basic"
              ],
              "pattern": "^(.*)$"
            },
            "created_at": {
              "$id": "#/properties/data/properties/token/properties/created_at",
              "type": "number",
              "title": "The Created_at Schema",
              "default": 0,
              "examples": [
                1580420885
              ]
            }
          }
        }
      }
    }
  }
}

